import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';

function Home() {
  return (
    <div>
      <h1>Home Service Webbing</h1>
      <p>Professionelle Dienstleistungen für Ihre Bedürfnisse.</p>
    </div>
  );
}

function Admin() {
  return (
    <div>
      <h1>Admin-Bereich</h1>
      <p>Hier können Sie administrative Aufgaben durchführen.</p>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div className="App">
        {/* Navigation */}
        <div className="navbar-wrapper">
          <button className="navbar-btn">+</button>
          <div className="navbar-menu">
            <a href="/" className="nav-item"><i className="fas fa-home"></i></a>
            <a href="/admin" className="nav-item"><i className="fas fa-cog"></i></a>
          </div>
        </div>

        {/* Routes */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/admin" element={<Admin />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
